function gradient(input)
    output=input.*1.0;
    output[1]=input[2]-input[1];
    output[2:end]=diff(input)
    temp=output
    output[2:end-1]=temp[2:end-1]+output[3:end]
    output[2:end-1]=output[2:end-1]/2
    return(output)
end

function update_conc_upwind_advection(dx, dt, velocity, conc_old, reaction_stoich, reaction_source, F)
    array_size=length(conc_old);
    conc_new =  zeros(array_size);
    for i in 2:array_size-1
        if velocity[i] >= 0.0
            conc_new[i] = conc_old[i] + dt*velocity[i]*(conc_old[i-1] - conc_old[i])/dx + reaction_stoich[i]*reaction_source[i]*dx*dt/F/dx #i has units of amps per m^2
        else
            conc_new[i] = conc_old[i] + dt*velocity[i]*(conc_old[i] - conc_old[i+1])/dx + reaction_stoich[i]*reaction_source[i]*dx*dt/F/dx #i has units of amps per m^2
        end
    end
    if velocity[1] <= 0.0
        conc_new[1] = conc_old[1] - dt*velocity[1]*(conc_old[2])/dx + reaction_stoich[1]*reaction_source[1]*dx*dt/F/dx #i has units of amps per m^2
    else
        conc_new[1] = conc_old[1] - dt*velocity[1]*(conc_old[1])/dx + reaction_stoich[1]*reaction_source[1]*dx*dt/F/dx #i has units of amps per m^2
    end
    if velocity[end] <= 0.0
        conc_new[end] = conc_old[end] + dt*velocity[end]*(conc_old[end])/dx + reaction_stoich[end]*reaction_source[end]*dx*dt/F/dx  #i has units of amps per m^2
    else
        conc_new[end] = conc_old[end] + dt*velocity[end]*(conc_old[end-1])/dx + reaction_stoich[end]*reaction_source[end]*dx*dt/F/dx #i has units of amps per m^2
    end
    return(conc_new)
end
